// reducers.js
const initialState = {
    // Định nghĩa trạng thái ban đầu của ứng dụng
};

const rootReducer = (state = initialState, action) => {
    switch (action.type) {
        // Xử lý các hành động tương ứng và cập nhật trạng thái
        default: return state;
    }
};

export default rootReducer;
